CREATE VIEW [AppFoundry.Core].[ColumnView] AS 
SELECT 	[ColumnAlias].[TableID] 'TableID' 
		,[ColumnAlias].[RelationshipTableID] 'RelationshipTableID' 
		,[ColumnAlias].[ColumnID] 'ColumnID' 
		,[ColumnAlias].[Name] 'Name' 
		,[ColumnAlias].[Type] 'Type' 
		,[ColumnAlias].[ViewDefinition] 'ViewDefinition' 
		,[ColumnAlias].[ColumnVersion] 'ColumnVersion' 
		,rs.[Name] 'RelationshipSchemaName' 
		,rt.[Name] 'RelationshipTableName' 
		,[ColumnAlias].[System] 'System' 
		,t.[Name] 'TableName' 
		,s.[Name] 'SchemaName' 
		,[ColumnAlias].[ScriptIdentifier] 'ScriptIdentifier' 
FROM [AppFoundry.Core].[Column] [ColumnAlias] 
INNER JOIN [AppFoundry.Core].[Table] t on t.[TableID] = [ColumnAlias].[TableID] INNER JOIN [AppFoundry.Core].[Schema] s on s.[SchemaID] = t.[SchemaID] LEFT OUTER JOIN [AppFoundry.Core].[Table] rt on rt.[TableID] = [ColumnAlias].[RelationshipTableID] LEFT OUTER JOIN [AppFoundry.Core].[Schema] rs on rs.[SchemaID] = rt.[SchemaID]
GO
CREATE VIEW [AppFoundry.Core].[BusinessObjectTypePermissionView] AS 
SELECT 	[BusinessObjectTypePermissionAlias].[RoleID] 'RoleID' 
		,[BusinessObjectTypePermissionAlias].[BusinessObjectTypePermissionID] 'BusinessObjectTypePermissionID' 
		,[BusinessObjectTypePermissionAlias].[BusinessObjectTypePermissionVersion] 'BusinessObjectTypePermissionVersion' 
		,[BusinessObjectTypePermissionAlias].[BusinessObjectTypeID] 'BusinessObjectTypeID' 
		,[BusinessObjectTypePermissionAlias].[CanCreate] 'CanCreate' 
		,[BusinessObjectTypePermissionAlias].[CanRead] 'CanRead' 
		,[BusinessObjectTypePermissionAlias].[CanUpdate] 'CanUpdate' 
		,[BusinessObjectTypePermissionAlias].[CanDelete] 'CanDelete' 
		,[bot].[ModuleID] 'ModuleID' 
FROM [AppFoundry.Core].[BusinessObjectTypePermission] [BusinessObjectTypePermissionAlias] 
INNER JOIN [AppFoundry.Core].[BusinessObjectType] [bot] on [bot].BusinessObjectTypeID = [BusinessObjectTypePermissionAlias].[BusinessObjectTypeID] 
GO
CREATE VIEW [AppFoundry.Business].[UserRoleView] AS 
SELECT 	[UserRoleAlias].[UserRoleID] 'UserRoleID' 
		,[UserRoleAlias].[UserRoleVersion] 'UserRoleVersion' 
		,[UserRoleAlias].[UserID] 'UserID' 
		,[UserRoleAlias].[RoleID] 'RoleID' 
		,[r].[Name] 'Name' 
		,[r].[Code] 'Code' 
		,[r].[Description] 'Description' 
FROM [AppFoundry.Business].[UserRole] [UserRoleAlias] 
INNER JOIN [AppFoundry.Core].[Role] [r] on [r].[RoleID] = [UserRoleAlias].[RoleID] 
GO
