INSERT INTO [AppFoundry.Business].[User]
select 1 'UserVersion', uat.[UserAuthenticationTypeID] 'AuthenticationTypeID', 'SystemAdmin' 'Name',NULL 'Password', NULL 'Salt', 'System Administrator' 'Display Name', NULL 'PersonID', 'SystemAdmin' 'Code', 1 'IsActive'
from [AppFoundry.Business].[UserAuthenticationType] uat
INNER JOIN [AppFoundry.Business].[Lookup] l on l.LookupID = uat.LookupID
where l.[Code] = 'UserNameAndPassword'
GO
INSERT INTO [AppFoundry.Business].[UserRole]
select 1 'UserRoleVersion', u.[UserID], (select RoleID from [AppFoundry.Core].[Role] where Code = 'SystemAdmin') 'RoleID'
from [AppFoundry.Business].[User] u
where u.Code = 'SystemAdmin'
GO
